class Solution {

    /**
     * @param Integer[] $nums
     * @param Integer $indexDifference
     * @param Integer $valueDifference
     * @return Integer[]
     */
    function findIndices($nums, $indexDifference, $valueDifference) {
        $n = count($nums);
        for ($i = 0; $i < $n; $i++) {
            for ($j = 0; $j < $n; $j++) {
                if (abs($i - $j) >= $indexDifference && abs($nums[$i] - $nums[$j]) >= $valueDifference) {
                    return [$i, $j];
                }
            }
        }
        return [-1, -1];
    }
}
